import { Component } from "@angular/core";

@Component({
  selector: "app-about",
  template: `
    <div class="container" style="padding-top: 65px">
      <h3>CTFWriteups.org</h3>

      <p>CTFWriteups.org is a place to share and learn from CTF Writeups</p>

      <h3>F.A.Q.</h3>

      <h4>Why did you build this?</h4>
      <p>The idea started <a href="https://twitter.com/c0nrad_jr/status/1726216778077053363">here</a> and grew. I learn from CTF writeups and wanted a tool to help organize and share them.</p>
    </div>
  `,
  styles: [],
})
export class AboutComponent {}
